var express = require("express");
var app = express();
var bodyParser = require('body-parser');

app.use(bodyParser.urlencoded({ extended: true }));

var campgrounds = [
    { name: "Niraj Kumar", image: "data:image/jpeg;base64," },
    { name: "Sonu Kumar", image: "data:image/jpeg;base64," },
    { name: "Mukesh Kumar", image: "data:image/jpeg;base64," },
    { name: "Dheeraj", image: "https://farm9.staticflickr.com/8041/7930201874_6c17ed670a.jpg"},
    { name: "Rakesh", image: "https://farm4.staticflickr.com/3751/9580653400_e1509d6696.jpg"},
    { name: "Shayam", image: "https://farm5.staticflickr.com/4423/37232133702_342e447ccb.jpg"},
    { name: "Rusty", image: "https://farm4.staticflickr.com/3888/15016796272_18ba446fc0.jpg" },
    { name: "Libo", image: "https://farm4.staticflickr.com/3247/2984118763_043f6f486e.jpg"}
];

app.get("/", function (req, res) {
    res.render("landing.ejs");
});

app.get("/campgrounds", function (req, res) {
    res.render("campgrounds.ejs", {campgrounds : campgrounds});
});

app.post("/campgrounds", function (req, res) {
    var name = req.body.name;
    var image = req.body.image;
    campgrounds.push({ name: name, image: image });
    res.redirect("/campgrounds");
});

app.get("/campgrounds/new", function (req, res) {
    res.render("new.ejs");
});

app.listen(200, function () {
    console.log("The YelpCamp Server is running");
});